DROP TABLE IF EXISTS `Goalkeepers`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `Goalkeepers` (
  `idGoalkeepers` int(11) NOT NULL AUTO_INCREMENT,
  `Firstname` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Surname` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Player_Number` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Games` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Minutes_Played` int(11) DEFAULT NULL,
  `Clean_Sheets` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Goals_Against` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Yellow Cards` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Red Cards` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Date_of_Birth` date DEFAULT NULL,
  `Height` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Signed` date DEFAULT NULL,
  `Nationality` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Picture` blob,
  PRIMARY KEY (`idGoalkeepers`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
