  `Tackles` int(11) DEFAULT NULL,
  `Date_Of_Birth` date DEFAULT NULL,
  `Height` date DEFAULT NULL,
  `Debut` date DEFAULT NULL,
  `Nationality` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Player_Number` int(11) DEFAULT NULL,
  `Picture` blob,
  PRIMARY KEY (`idMidfielders`)
