  `Date_Of_Birth` date DEFAULT NULL,
  `Height` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Signed` date DEFAULT NULL,
  `Nationality` int(11) DEFAULT NULL,
  `Picture` blob,
  PRIMARY KEY (`idStrikers`)
